import React from "react";
import ActionCard from "../components/ActionCard";
import { 
  Box, 
  Grid, 
  Typography, 
  Paper, 
  Table, 
  TableBody, 
  TableCell, 
  TableContainer, 
  TableHead, 
  TableRow, 
  Chip,
  IconButton,
  Tooltip
} from "@mui/material";
import { useTheme } from "@mui/material/styles";
import { Link as RouterLink } from "react-router-dom";
import TrainIcon from "@mui/icons-material/Train";
import WarningAmberIcon from "@mui/icons-material/WarningAmber";
import AccessTimeIcon from "@mui/icons-material/AccessTime";
import HealthAndSafetyIcon from "@mui/icons-material/HealthAndSafety";
import AssignmentIcon from "@mui/icons-material/Assignment";
import WorkIcon from "@mui/icons-material/Work";
import CampaignIcon from "@mui/icons-material/Campaign";
import SpeedIcon from "@mui/icons-material/Speed";
import CleaningServicesIcon from "@mui/icons-material/CleaningServices";
import LocationOnIcon from "@mui/icons-material/LocationOn";
import VisibilityIcon from "@mui/icons-material/Visibility";

// DASHBOARD CARDS DATA
const dashboardCards = [
  {
    title: "Trains Ready",
    main: "147",
    sub: "180",
    icon: <TrainIcon color="primary" sx={{ fontSize: 40 }} />
  },
  {
    title: "Maintenance Alerts",
    main: "8",
    sub: "Active",
    icon: <WarningAmberIcon color="warning" sx={{ fontSize: 40 }} />
  },
  {
    title: "Ad Deadlines",
    main: "3",
    sub: "This Week",
    icon: <AccessTimeIcon color="secondary" sx={{ fontSize: 40 }} />
  },
  {
    title: "System Health",
    main: "98.2%",
    sub: "Uptime",
    icon: <HealthAndSafetyIcon color="success" sx={{ fontSize: 40 }} />
  }
];

// SAMPLE DATA FOR NEW MODULES
const fitnessCertificatesData = [
  { trainId: "TR-4521", status: "Valid", expiry: "2024-03-15", type: "Annual", risk: "Low" },
  { trainId: "TR-4522", status: "Due Soon", expiry: "2024-01-20", type: "Monthly", risk: "Medium" },
  { trainId: "TR-4523", status: "Expired", expiry: "2023-12-10", type: "Quarterly", risk: "High" },
  { trainId: "TR-4524", status: "Valid", expiry: "2024-06-30", type: "Annual", risk: "Low" },
  { trainId: "TR-4525", status: "Valid", expiry: "2024-02-28", type: "Monthly", risk: "Low" }
];

const jobCardData = [
  { jobId: "JC-2024-001", train: "TR-4521", type: "Brake System", status: "Open", priority: "High", assigned: "Team A" },
  { jobId: "JC-2024-002", train: "TR-4522", type: "Engine Check", status: "Closed", priority: "Medium", assigned: "Team B" },
  { jobId: "JC-2024-003", train: "TR-4523", type: "Cleaning", status: "Open", priority: "Low", assigned: "Team C" },
  { jobId: "JC-2024-004", train: "TR-4524", type: "Brake System", status: "Open", priority: "High", assigned: "Team A" },
  { jobId: "JC-2024-005", train: "TR-4525", type: "Engine Check", status: "Closed", priority: "Medium", assigned: "Team B" }
];

const brandingData = [
  { campaign: "Metro Express", train: "TR-4521", status: "Active", expiry: "2024-06-15", revenue: "$15,000" },
  { campaign: "City Connect", train: "TR-4522", status: "Active", expiry: "2024-04-20", revenue: "$12,500" },
  { campaign: "Rapid Transit", train: "TR-4523", status: "Expired", expiry: "2023-12-31", revenue: "$8,000" },
  { campaign: "Metro Express", train: "TR-4524", status: "Active", expiry: "2024-08-10", revenue: "$18,000" },
  { campaign: "City Connect", train: "TR-4525", status: "Active", expiry: "2024-05-25", revenue: "$14,200" }
