                position: 'relative',
                height: '100%',
                transition: 'transform .15s ease, box-shadow .2s ease, border-color .2s ease',
                '&:hover': {
                  transform: 'translateY(-3px)',
                  boxShadow: isDark ? '0 16px 32px rgba(0,0,0,0.65)' : '0 14px 28px rgba(48,213,200,0.33)',
                  borderColor: isDark ? '#30D5C844' : '#30D5C8'
                }
              }}>
                <Box sx={{ position: 'absolute', top: 0, left: 0, right: 0, height: 4, bgcolor: HIGHLIGHT, borderTopLeftRadius: 8, borderTopRightRadius: 8 }} />
                <Typography variant="subtitle1" fontWeight={600}>
                  {t.systemStatus}
                </Typography>
                <Typography variant="body2" sx={{ color: 'text.secondary' }}>
                  {t.operational} / {t.secure}
                </Typography>
              </Paper>
            </Grid>
            <Grid item xs={12} md={4}>
              <Paper sx={{
                bgcolor: isDark ? '#0f1a1d' : '#ffffff',
                p: 3,
                borderRadius: 2,
                boxShadow: isDark ? '0 8px 20px rgba(0,0,0,0.5)' : '0 10px 24px rgba(48,213,200,0.14)',
                border: `1px solid ${isDark ? '#ffffff22' : '#607D8B33'}`,
                position: 'relative',
                height: '100%',
                transition: 'transform .15s ease, box-shadow .2s ease, border-color .2s ease',
                '&:hover': {
                  transform: 'translateY(-3px)',
                  boxShadow: isDark ? '0 16px 32px rgba(0,0,0,0.65)' : '0 14px 28px rgba(48,213,200,0.33)',
                  borderColor: isDark ? '#30D5C844' : '#30D5C8'
                }
              }}>
                <Box sx={{ position: 'absolute', top: 0, left: 0, right: 0, height: 4, bgcolor: HEADINGS, borderTopLeftRadius: 8, borderTopRightRadius: 8 }} />
                <Typography variant="subtitle1" fontWeight={600}>
                  {t.loginSuccessful}
                </Typography>
                <Typography variant="body2" sx={{ color: 'text.secondary' }}>
                  {t.welcomeMessage}
                </Typography>
              </Paper>
            </Grid>
          </Grid>
          
          {/* NEW MODULES SECTION */}
          <Box sx={{ height: 6, borderRadius: 2, background: `linear-gradient(90deg, ${PRIMARY}, ${HIGHLIGHT})`, mb: 2, mt: 4 }} />
          <Typography variant="h6" fontWeight={800} mt={1} mb={0.5} sx={{ color: 'text.primary' }}>
            {t.dataModules}
          </Typography>
          <Typography mb={3} variant="body2" sx={{ color: 'text.secondary' }}>
            Comprehensive operational modules for railway management
          </Typography>
          
          {/* FITNESS CERTIFICATES & JOB CARD STATUS */}
          <Grid container spacing={3} mb={3}>
            <Grid item xs={12} lg={6}>
              <FitnessCertificatesModule t={t} isDark={isDark} PRIMARY={PRIMARY} />
            </Grid>
            <Grid item xs={12} lg={6}>
              <JobCardStatusModule t={t} isDark={isDark} HIGHLIGHT={HIGHLIGHT} />
            </Grid>
          </Grid>
          
          {/* BRANDING PRIORITIES & MILEAGE BALANCING */}
          <Grid container spacing={3} mb={3}>
            <Grid item xs={12} lg={6}>
              <BrandingPrioritiesModule t={t} isDark={isDark} HEADINGS={HEADINGS} />
            </Grid>
            <Grid item xs={12} lg={6}>
              <MileageBalancingModule t={t} isDark={isDark} PRIMARY={PRIMARY} />
            </Grid>
          </Grid>
          
          {/* CLEANING & DETAILING & STABLING GEOMETRY */}
          <Grid container spacing={3} mb={3}>
            <Grid item xs={12} lg={6}>
              <CleaningDetailingModule t={t} isDark={isDark} HIGHLIGHT={HIGHLIGHT} />
            </Grid>
            <Grid item xs={12} lg={6}>
              <StablingGeometryModule t={t} isDark={isDark} HEADINGS={HEADINGS} />
            </Grid>
          </Grid>
    </Box>
  );
}
